import React from 'react';
import { Header, Icon, Segment } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Segment placeholder>
                <div as='h2' icon textAlign='center'>
                    <video autoPlay loop muted
                        style={{
                            position: "relative",
                            width: "100%",
                            top: "0%",
                            left: "50%",
                            objectFit: "cover",
                            transform: "translate(-50%,-10%)"
                            //zIndex: "-1"
                        }}
                    >
                        <source src={Vikings} type="video/mp4" />
                    </video>

                </div>
            </Segment>

        </React.Fragment>
    )
}

